css:
@-moz-document domain("docs.mapbox.com") {
body, .border--gray-light {
    background-color: #222!important;
    color: #eee;
}
.prose code:not(.unprose), .prose pre:not(.unprose) {
    background-color: #191919!important;
    color: #fff;
}
/*.prose code:not(.unprose) .punctuation, .prose code:not(.unprose) .operator, .prose pre:not(.unprose) .punctuation, .prose pre:not(.unprose) .operator {
    color: #eee;
}*/
 .token.tag {
    color: #3cf;
}
.token.punctuation {
    color: #ddd;
}
.prose code:not(.unprose) .function, .prose code:not(.unprose) .keyword, .prose pre:not(.unprose) .function, .prose pre:not(.unprose) .keyword {
    color: #09f;
}
.prose code:not(.unprose) .string, .prose pre:not(.unprose) .string {
    color: #4c3;
}
.bg-gray-faint {
    background-color: #252525!important;
}
.token.attr-value {
    color: #69f;
}
.token.property {
    color: #f90;
}
.token.number {
    color: #e30;
}
.token.comment {
    color: #999;
}
/* .color-darken75 */
 *[class*="color-darken"] {
    color: #eee!important;
    background-color: #252525!important;
}
/* .bg-lighten75 */
 * *[class*="bg-lighten"] {
    background-color: transparent!important;
}
.color-gray {
    color: #bbb!important;
}
.color-black {
    color: #eee!important;
}

.shell-wrapper .shell-color-gray-dark {
    color: #efe!important;
}

input.bg-white {
    color: #eee!important;
    background-color: #252525!important;
}
*[id*="api-reference-search-item"] {
    color: #eee!important;
    background-color: #252525!important;
    
}
}
